  /* Check with double */
  x = may_set_d (-42.0);
  dummy = may_get_si (&v, x);
  if (dummy != 1 || v != -42)
    fail ("set_d / get_si doesn't work", x);
  x = may_set_d (LONG_MAX*4.0);
  dummy = may_get_si (&v, x);
  if (dummy != -2)
    fail ("set_d / get_si doesn't overflow", x);

