void test_set_list ()
{
  may_t x;
  may_t list[10];
  int i;

  may_mark ();
  for (i = 0 ; i < 10 ; i++)
    list[i] = may_set_ui (i*i-12);
  x = may_list_vc (10, list);
  if (may_nops(x) != 10
      || ({ for(i = 0 ; i < 10 ; i++)
	if (may_identical(list[i], may_op (x, i))) break;
      (i != 10); }))
    fail("set/get_list", x);
  if (may_op (x, 11) != NULL)
    fail("set/get_list 2", x);

  x = may_list_vac (may_set_ui (0),
                    may_set_ui (1),
                    may_set_ui (2), NULL);
  if (may_nops (x) != 3
      || ({ for(i = 0 ; i < 3 ; i++)
            if (may_identical(may_set_ui (i), may_op (x, i))) break;
          (i != 3); }))
    fail ("list_vac", x);

  may_keep (NULL);
}

