void test_extract_pi_factor ()
{
  may_t s, x;

  may_mark ();
  s = may_parse_str ("x+y+2*PI");

  x = may_cos (s);
  check (x, "cos(y+x)");
  check (s, "y+x+2*PI");

  x = may_sin (s);
  check (x, "sin(y+x)");
  check (s, "y+x+2*PI");

  x = may_tan (s);
  check (x, "tan(y+x)");
  check (s, "y+x+2*PI");

  x = may_set_str ("x");
  s = may_asin (x);
  check (s, "asin(x)");
  s = may_acos (x);
  check (s, "acos(x)");
  s = may_atan (x);
  check (s, "atan(x)");
  s = may_asinh (x);
  check (s, "asinh(x)");
  s = may_acosh (x);
  check (s, "acosh(x)");
  s = may_atanh (x);
  check (s, "atanh(x)");
  s = may_sinh (x);
  check (s, "sinh(x)");
  s = may_cosh (x);
  check (s, "cosh(x)");
  s = may_tanh (x);
  check (s, "tanh(x)");

  may_keep (NULL);
}

void test_ifactor (void)
{
  may_mark ();

  may_t n = may_set_ui (76931800UL);
  may_t l = may_naive_ifactor (n);
  char *str = may_get_string (NULL, 0, l);
  if (strcmp (str, "{3,2,2,5,3,11,2,17}") != 0) {
    printf ("Error for ifactor\n Get: %s\n", str);
    test_fail ();
  }
  n = may_set_ui (3*10037);
  l = may_naive_ifactor (n);
  str = may_get_string (NULL, 0, l);
  if (strcmp (str, "{1,3,1,10037}") != 0) {
    printf ("Error for ifactor (2)\n Get: %s\n", str);
    test_fail ();
  }

  may_keep (NULL);
}


