  check_string (may_get_string (NULL, 0, a), "asinh(2)");
  a = may_parse_str ("acosh(2)");
  check_string (may_get_string (NULL, 0, a), "acosh(2)");
  a = may_parse_str ("atanh(2)");
  check_string (may_get_string (NULL, 0, a), "atanh(2)");
