void test_texpand (void)
{
  may_t a;
  may_mark ();

  /* Simple cases */
  a = may_parse_str ("sin(a+b)");
  a = may_texpand (a);
  check (a, "cos(a)*sin(b)+sin(a)*cos(b)");
  a = may_parse_str ("sin(a-b)");
  a = may_texpand (a);
  check (a, "-cos(a)*sin(b)+sin(a)*cos(b)");

  a = may_parse_str ("cos(a+b)");
  a = may_texpand (a);
  check (a, "cos(a)*cos(b) - sin(a)*sin(b)");
  a = may_parse_str ("cos(a-b)");
  a = may_texpand (a);
  check (a, "cos(a)*cos(b) + sin(a)*sin(b)");

  a = may_parse_str ("sinh(a+b)");
  a = may_texpand (a);
  check (a, "cosh(a)*sinh(b)+sinh(a)*cosh(b)");
  a = may_parse_str ("sinh(a-b)");
  a = may_texpand (a);
  check (a, "-cosh(a)*sinh(b)+sinh(a)*cosh(b)");

  a = may_parse_str ("cosh(a+b)");
  a = may_texpand (a);
  check (a, "cosh(a)*cosh(b) + sinh(a)*sinh(b)");
  a = may_parse_str ("cosh(a-b)");
  a = may_texpand (a);
  check (a, "cosh(a)*cosh(b) - sinh(a)*sinh(b)");

  a = may_parse_str ("cos (2*x)");
  a = may_texpand (a);
  check (a, "2*cos(x)^2-1");
  a = may_parse_str ("cos (3*x)");
  a = may_texpand (a);
  check (a, "4*cos(x)^3-3*cos(x)");
  a = may_parse_str ("cos (4*x)");
  a = may_texpand (a);
  check (a, "8*cos(x)^4-8*cos(x)^2+1");
  a = may_parse_str ("cos (5*x)");
  a = may_texpand (a);
  check (a, "16*cos(x)^5-20*cos(x)^3+5*cos(x)");

  a = may_parse_str ("cosh (2*x)");
  a = may_texpand (a);
  check (a, "2*cosh(x)^2-1");
  a = may_parse_str ("cosh (3*x)");
  a = may_texpand (a);
  check (a, "4*cosh(x)^3-3*cosh(x)");
  a = may_parse_str ("cosh (4*x)");
  a = may_texpand (a);
  check (a, "8*cosh(x)^4-8*cosh(x)^2+1");
  a = may_parse_str ("cosh (5*x)");
  a = may_texpand (a);
  check (a, "16*cosh(x)^5-20*cosh(x)^3+5*cosh(x)");

  a = may_parse_str ("sin (2*x)");
  a = may_texpand (a);
  check (a, "2*sin(x)*cos(x)");
  a = may_parse_str ("sin (3*x)");
  a = may_texpand (a);
  check (a, "-4*sin(x)^3+3*sin(x)");
  a = may_parse_str ("sin (4*x)");
  a = may_texpand (a);
  check (a, "-4*(2*sin(x)^3-sin(x))*cos(x)");
  a = may_parse_str ("sin (5*x)");
  a = may_texpand (a);
  check (a, "16*sin(x)^5-20*sin(x)^3+5*sin(x)");

  a = may_parse_str ("sinh (2*x)");
  a = may_texpand (a);
  check (a, "2*sinh(x)*cosh(x)");
  a = may_parse_str ("sinh (3*x)");
  a = may_texpand (a);
  check (a, "4*sinh(x)^3+3*sinh(x)");
  a = may_parse_str ("sinh (4*x)");
  a = may_texpand (a);
  check (a, "4*(2*sinh(x)^3+sinh(x))*cosh(x)");
  a = may_parse_str ("sinh (5*x)");
  a = may_texpand (a);
  check (a, "16*sinh(x)^5+20*sinh(x)^3+5*sinh(x)");

  /* Complex ones */
  a = may_parse_str ("sin(a-2*b)");
  a = may_texpand (a);
  check (a, "-sin(a)*(1-2*cos(b)^2)-2*cos(b)*sin(b)*cos(a)");
  a = may_parse_str ("sinh(a-2*b)");
  a = may_texpand (a);
  check (a, "-2*cosh(b)*sinh(b)*cosh(a)-sinh(a)*(1-2*cosh(b)^2)");
  a = may_parse_str ("cos(a-2*b)");
  a = may_texpand (a);
  check (a, "-cos(a)*(1-2*cos(b)^2)+2*cos(b)*sin(b)*sin(a)");
  a = may_parse_str ("cosh(a-2*b)");
  a = may_texpand (a);
  check (a, "-2*cosh(b)*sinh(b)*sinh(a)-cosh(a)*(1-2*cosh(b)^2)");

  /* Tan */
  a = may_parse_str ("tan(a+b)");
  a = may_texpand (a);
  check (a, "(tan(b)+tan(a))/(1-tan(b)*tan(a))");
  a = may_parse_str ("tan(2*a)");
  a = may_texpand (a);
  check (a, "-2*tan(a)/((1-2/(1+tan(a)^2))*(1+tan(a)^2))");
  a = may_rationalize (a);
  check (a, "2*tan(a)/(1-tan(a)^2)");

  /* Tanh */
  a = may_parse_str ("tanh(a+b)");
  a = may_texpand (a);
  check (a, "(tanh(b)+tanh(a))/(1+tanh(b)*tanh(a))");
  a = may_parse_str ("tanh(2*a)");
  a = may_rationalize (may_texpand (a));
  check (a, "2*tanh(a)/(1+tanh(a)^2)");


  /* Test eexpand */
  check (may_eexpand (may_parse_str ("exp(2*a+b-2)")),
         "exp(a)^2*exp(b)/exp(2)");

  may_keep (NULL);
}

void test_elist (void)
{
  may_t x;
  may_mark ();

  x = may_parse_str ("{2}");
  check (x, "{2}");

  x = may_parse_str ("{2,2}+x+1+{-3,4}");
  check (x, "{x,7+x}");

  x = may_parse_str ("2+{2,{a,b}}+x+{2,x}");
  check (x, "{6+x,{2+a+2*x,2+b+2*x}}");

  x = may_parse_str ("{2,3}*x");
  check (x, "{2*x,3*x}");

  x = may_parse_str ("{2,3}*{4,5}*y*{a,b}*z");
  check (x, "{8*y*z*a,15*b*y*z}");

  x = may_parse_str ("{2,3}*{4,5}*y*{a,b}*z-{a,b}");
  check (x, "{8*y*z*a-a,-b+15*b*y*z}");

  x = may_parse_str ("-PI*{a,b}^2");
  check (x, "{-a^2*PI,-b^2*PI}");

  x = may_parse_str ("{2,3}+{2,3}");
  check (x, "{4,6}");

  x = may_parse_str ("{2,3}-{2,3}");
  check (x, "{0,0}");

  x = may_parse_str ("{2,3}^2");
  check (x, "{4,9}");

  x = may_parse_str ("{2,3}^{x,y}");
  check (x, "{2^x,3^y}");

  x = may_parse_str ("2^{x,y}");
  check (x, "{2^x,2^y}");

  x = may_parse_str ("LIST(2,3)");
  check (x, "{2,3}");

  may_keep (NULL);
}

void test_approx (void)
{
  may_t a;

  may_kernel_num_presimplify (0);
  may_mark ();

  a = may_parse_str ("exp(PI*sqrt(163))");
  a = may_approx (a, 10, 50, GMP_RNDN);
  check (a, "2.6253741264076874399999999999925007259719818568888E17");

  a = may_parse_str ("262537412640768744-exp(PI*sqrt(163))");
  a = may_approx (a, 10, 3, GMP_RNDN);
  check (a, "7.50E-13");

  a = may_parse_str ("sqrt(3)*sqrt(2)-sqrt(6)");
  a = may_approx (a, 10, 50, GMP_RNDN);
  check (a, "0");

  may_keep (NULL);
  may_kernel_num_presimplify (1);
}

