void test_combine (void)
{
  may_t a;

  may_mark ();

  a = may_parse_str ("PI^n*PI^m");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "PI^(m+n)");

  a = may_parse_str ("PI^n*PI*2");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "2*PI^(1+n)");

  a = may_parse_str ("(PI^PI)^m");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "PI^(m*PI)");

  a = may_parse_str ("(PI^x)^3");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "(PI^x)^3");

  a = may_parse_str ("PI^2*(PI^x)^3");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "PI^(2+3*x)");

  a = may_parse_str ("exp(a)*exp(b)");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(a+b)");

  a = may_parse_str ("exp(a)^3");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(3*a)");

  a = may_parse_str ("exp(6*I)^(1/2)");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(3*I)");

  a = may_parse_str ("a^log(b)");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(log(a)*log(b))");

  a = may_parse_str ("a^b*exp(c)");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "a^b*exp(c)");;
  a = may_parse_str ("a^b*exp(c)");
  a = may_combine (a, MAY_COMBINE_FORCE);
  check (a, "exp(c+b*log(a))");

  a = may_parse_str ("x^n*x^m");
  a = may_combine (a, MAY_COMBINE_FORCE);
  check (a, "x^(m+n)");

  a = may_parse_str ("abs(a*x)^2");
  a = may_combine (a, MAY_COMBINE_FORCE);
  check (a, "abs(x)^2*abs(a)^2");

  a = may_parse_str ("exp(x)/y");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(x)/y");
  a = may_parse_str ("exp(x)/PI");
  a = may_combine (a, MAY_COMBINE_NORMAL);
  check (a, "exp(x-log(PI))");
  a = may_parse_str ("exp(x)/y");
  a = may_combine (a, MAY_COMBINE_FORCE);
  check (a, "exp(-log(y)+x)");

  may_keep (NULL);
}

void test_tcollect (void)
{
  may_t a;
  may_mark ();

  a = may_parse_str ("cos(x)");
  a = may_tcollect (a);
  check (a, "cos(x)");

  a = may_parse_str ("sin(x)");
  a = may_tcollect (a);
  check (a, "sin(x)");

  a = may_parse_str ("tan(x)");
  a = may_tcollect (a);
  check (a, "sin(x)/cos(x)");

  a = may_parse_str ("sin(x)/cos(x)");
  a = may_tcollect (a);
  check (a, "sin(x)/cos(x)");

  a = may_parse_str ("cos(x)^4");
  a = may_tcollect (a);
  check (a, "3/8+1/2*cos(2*x)+1/8*cos(4*x)");

  a = may_parse_str ("sin(x)^5");
  a = may_tcollect (a);
  check (a, "5/8*sin(x)-5/16*sin(3*x)+1/16*sin(5*x)");

  a = may_parse_str ("tan(x)^6");
  a = may_tcollect (a);
  check (a, "(10-15*cos(2*x)+6*cos(4*x)-cos(6*x))/(10+cos(6*x)+6*cos(4*x)+15*cos(2*x))");

  a = may_parse_str ("cos(2*x)^5*sin(3*y)^6");
  a = may_tcollect (a);
  check (a, "25/128*cos(2*x)-75/512*cos(-2*x+6*y)-75/512*cos(2*x+6*y)+15/256*cos(-2*x+12*y)+15/256*cos(2*x+12*y)-5/512*cos(-2*x+18*y)-5/512*cos(2*x+18*y)+25/256*cos(6*x)-75/1024*cos(-6*x+6*y)-75/1024*cos(6*x+6*y)+15/512*cos(-6*x+12*y)+15/512*cos(6*x+12*y)-5/1024*cos(-6*x+18*y)-5/1024*cos(6*x+18*y)+5/256*cos(10*x)-15/1024*cos(-10*x+6*y)-15/1024*cos(10*x+6*y)+3/512*cos(-10*x+12*y)+3/512*cos(10*x+12*y)-1/1024*cos(-10*x+18*y)-1/1024*cos(10*x+18*y)");

  a = may_parse_str ("cos(x)*cos(y)");
  a = may_tcollect (a);
  check (a, "1/2*cos(y-x)+1/2*cos(y+x)");

  a = may_parse_str ("cosh(x)*cosh(y)");
  a = may_tcollect (a);
  check (a, "1/2*cosh(y-x)+1/2*cosh(y+x)");

  a = may_parse_str ("cos(x)^3");
  a = may_tcollect (a);
  check (a, "1/4*cos(3*x)+3/4*cos(x)");

  a = may_parse_str ("sin(2*x)^2");
  a = may_tcollect (a);
  check (a, "1/2-1/2*cos(4*x)");

  a = may_parse_str ("x*sin(x)*cos(x)");
  a = may_tcollect (a);
  check (a, "1/2*sin(2*x)*x");

  a = may_parse_str ("cos(x)*tan(x)^3");
  a = may_tcollect (a);
  check (a, "-1/2*(sin(3*x)-3*sin(x))*(1+cos(2*x))^-1");

  may_keep (NULL);
}

