  memset (callback_table, 0, sizeof callback_table);
  callback_num = 0;
  x = may_parse_str ("2+A(1)+B(1)+A(3)+B(4)+C(5)+A(6)+C(7)");
  check_bool (callback_num == 17);

  check_string (callback_table[0] , "a_constructor");
