  check_string (callback_table[3] , "b_constructor");
  check_string (callback_table[4] , "c_constructor");
  check_string (callback_table[5] , "a_constructor");
  check_string (callback_table[6] , "c_constructor");

  check_string (callback_table[7] , "a_eval");
  check_string (callback_table[8] , "b_eval");
  check_string (callback_table[9] , "a_eval");
