  check (num, "1");
  i = may_sum_iterator_end (&f, &b, it);
  check_bool (i == 1);
  check (f, "1");
  check (b, "n");
  may_sum_iterator_next (it);
  i = may_sum_iterator_end (&f, &b, it);
  check_bool (i == 0);

  x = may_parse_str ("y^2*x*2");
  check_bool (may_product_p (x));
  num = may_product_iterator_init (it, x);
  check (num, "2");
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i != 0);
  check (f, "2");
  check (b, "y");
  may_product_iterator_next (it);
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i != 0);
  check (f, "1");
  check (b, "x");
  may_product_iterator_next (it);
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i == 0);

  x = may_parse_str ("x*2");
  check_bool (may_product_p (x));
  num = may_product_iterator_init (it, x);
  check (num, "2");
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i != 0);
  check (f, "1");
  check (b, "x");
  may_product_iterator_next (it);
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i == 0);

  x = may_parse_str ("3");
  check_bool (may_product_p (x) == 0);
  num = may_product_iterator_init (it, x);
  check (num, "3");
  i = may_product_iterator_end (&f, &b, it);
  check_bool (i == 0);

  x = may_parse_str (" x^n");
  check_bool (may_product_p (x) == 0);
  num = may_product_iterator_init (it, x);
