void test_antidiff ()
{
  may_t e, x;
  may_mark ();
  for (int i = 0 ; i < numberof (table_antidiff) ; i+=2) {
    e = may_parse_str (table_antidiff[i]);
    x = may_set_str ("x");
    e = may_antidiff (e, x);
    if (e != NULL)
      check (e, table_antidiff[i+1]);
    else
      printf ("Warning: Can't integrate %s\n", table_antidiff[i]);
    may_compact (NULL);
  }
}

void test_rootof (void)
{
  may_rootof_ext_init();

  may_mark();
  may_t x;

  x = may_parse_str("ROOTOF(2,x+1,x)");
  check (x, "ROOTOF(2,x+1,x)");

  x = may_parse_str("ROOTOF(2,x+1,x)^2");
  check (x, "1+ROOTOF(2,1+x,x)");

  x = may_parse_str("ROOTOF(2,x+1,x)^3");
  check (x, "1+2*ROOTOF(2,1+x,x)");

  x = may_parse_str("ROOTOF(2,0,x)");
  check (x, "ROOTOF(2,0,x)");

  x = may_parse_str("ROOTOF(2,0,x)^2");
  check (x, "0");

  may_keep (NULL);
}


#if defined (MAY_WANT_THREAD)
int fib(int n);

struct fib2_s {
  int x, n;
};

static void subfunc_1 (void *data) {
  struct fib2_s *f = data;
  f->x = fib (f->n );
}

may_mark_t mark_thread;

/* Compute Fibonacci number using thread systems. */
int fib(int n)
{
  if (n < 2)
    return n;

  struct fib2_s f;
  may_spawn_block_t b;

  may_spawn_start(b, mark_thread);
  f.n = n - 2;
  may_spawn (b, subfunc_1, &f);
  int y = fib (n-1);
  may_spawn_sync(b);
  return f.x + y;
}

void test_thread(void)
{
  may_mark(mark_thread);
  for(int i = 1; i <=4 ;i++ ) {
    int previous = may_kernel_worker(i, 0);
    MAY_ASSERT (i == 1 || previous == (i-1));
    int result = fib(39);
    check_bool (result == 63245986);
  }
  may_compact(mark_thread, NULL);

  /* Compute reference */
  may_kernel_worker(1, 0);
  may_t temp[2], *temp_ptr = temp;
  temp[0]  = may_parse_str ("(1+x+y)^5*(1-x-y)^6");
  temp[1]  = may_parse_str ("(1+x-y)^5*(1-x+y)^6");
  may_t gcd1 = may_gcd(2, temp);

  may_t temp2[2], *temp2_ptr = temp2;
  temp2[0]  = may_parse_str ("(1-x+y)^5*(1-x-y)^6");
  temp2[1]  = may_parse_str ("(1+x-y)^5*(1-x+y)^6");
  may_t gcd2 = may_gcd(2, temp2);

  may_t r = may_expand (may_mul (gcd1, gcd2));

  /* Compute with workers */
  may_kernel_worker(2, 0);
  MAY_SPAWN_BLOCK(block, mark_thread);
  MAY_SPAWN (block, (temp_ptr),  { gcd1 = may_gcd(2, temp_ptr); }, (gcd1) );
  MAY_SPAWN (block, (temp2_ptr), { gcd2 = may_gcd(2, temp2_ptr); }, (gcd2) );
  MAY_SPAWN_SYNC(block);
  may_t r2 = may_expand (may_mul (gcd1, gcd2));
  may_compact_va (mark_thread, &r2, &r, NULL);

  /* Check if same */
  check_bool (may_identical (r, r2) == 0);

  may_compact(mark_thread, NULL);
}

void test_thread_for(void)
{
  may_mark_t mark;
  may_mark(mark);

  const int s = 1000000;
  int *a = may_alloc (s * sizeof(int));
  int *b = may_alloc (s * sizeof(int));
  for(int i = 0; i < s ; i++)
    a[i] = 3*i;

  MAY_SPAWN_FOR(mark, i, 0, s, (a, b), {
      b[i] = a[i];
    });

  for(int i = 0; i < s ; i++)
    check_si(b[i], 3*i);

#define REDUCE_ADD(a,b) (a) += (b)
  long long sum;
  int i = 500000;
  MAY_SPAWN_FOR_REDUCE(mark, i, 0, s, (b),
                       REDUCE_ADD, sum, b[i], {});
  check_bool ((sum = (long long) 3 * s * (s+1)));

  may_compact(mark, NULL);

}

#else
void test_thread(void) {}
void test_thread_for(void) {}
#endif

